        css: {
          opacity: 0,
          transform: "translateY(100px)"
        },
        ease: Strong.easeIn,
        delay: .1,
        onComplete: (function(_this) {
          return function() {
            $('.case').hide();
            $('#case_' + new_case_index).removeClass('passive').addClass('active').show();
            return TweenMax.to($('#case_' + new_case_index), .3, {
              css: {
                opacity: 1,
                transform: "translateY(0)"
              },
              ease: Strong.easeOut
            });
          };
        })(this)
